import React from 'react';
import styled from 'styled-components'
// import logo from './logo.svg';
import './App.css';

import MusicUI from 'sequencer'

const {
  ProgressionChordOptions,
  ProgressionWorkbench,
  ProgressionPatternOptions
} = MusicUI

const Workbench = styled.div`
  /* border: solid; */
  width: 100%;
`
const Options = styled.div`
  border-left: solid;
  width: 100%;
  height: 100%;
`

const Wrapper = styled.div`
  border: solid;
  display: flex;
  height: 25vh;
`

function App() {
  return (
    <div className="App">
      <Wrapper>

        <Workbench>
          <ProgressionWorkbench chords={[]} />
        </Workbench>

        <Options>
          <ProgressionPatternOptions/>
          <ProgressionChordOptions
            onSubmit={ () => console.log('submit') }
            onKeyChange={ () => console.log('KeyChange') }
            onModeChange={ () => console.log('ModeChange') }
          />
        </Options>

      </Wrapper>

    </div>
  );
}

export default App;
